INSERT INTO `jobs` (`JobID`, `JobTitle`, `RefNum`, `Salary`, `Location`, `Supervisor`, `EmpType`, `ExpLevel`, `Description`, `Img`) VALUES
(1, 'Junior Network Technician', 'JNT01', '$45,000 - $55,000 per annum', 'Ha Noi, Vietnam', 'Senior Network Administrator', 'Full-time', 'Entry-level', 'An entry-level role focused on the physical installation, configuration, and foundational maintenance of network hardware (routers, switches, firewalls) and cabling infrastructure.', 'images/job1.png'),
(2, 'Intern Business Analysis', 'IBA02', '$18 - $22 per hour', 'Ha Noi, Vietnam', 'Senior Business Analyst', 'Internship', 'None', 'A 3-6 month internship designed to give experience in documenting analyzing business requirements to support IT solutions within the network administration context.', 'images/job1.png'),
(3, 'Telephone Sales Representative', 'TSL03', '$40,000 - $50,000 base', 'Ha Noi, Vietnam', 'Sales Manager', 'Full-time', 'Entry-level', 'A sales role responsible for driving revenue growth by making outbound calls, responding to inbound inquiries, and selling our network administration services.', 'images/job1.png'),
(4, 'Network Infrastructure Analyst', 'NIA06', '$75,000 - $95,000 per annum', 'Da Nang, Vietnam', 'l', 'Full-time', '3+ years', 'A technical analysis role focused on optimizing network performance, reliability, and capacity. This position involves deep-dive troubleshooting, monitoring system health, and generating reports to guide strategic infrastructure upgrades and improvements.', 'images/job1.png'),
(5, 'IT Service Desk Manager', 'SDM07', '$95,000 - $115,000 per annum', 'HCM, Vietnam', 'Chief Information Officer', 'Full-time', '5 + years', 'A leadership role responsible for the overall operation, performance, and strategic direction of the IT Service Desk. The manager ensures high-quality end-user support, adherence to SLAs, and continuous improvement of service delivery processes.', 'images/job1.png');
